#!/bin/sh
#
# Prerequisites:
#
#     RUST_LOG=gwasm=debug,pallet_gear=debug cargo run -p gear-cli --release -- --dev --tmp -l0
#
# Then upload the PING program and copy it's ID.
# URL: https://github.com/gear-tech/apps/releases/download/build/demo_ping.opt.wasm
#
# Usage:
#
#     ./calc-gas-spent.sh
#

ALICE="0xd43593c715fdd31c61141abd04a99fd6822c8558854ccde39a5684e7a56da27d"
CODE_ID="$ALICE" # Replace it by the real code ID
PROG_ID="$ALICE" # Replace it by the real program ID
MSG_ID="$ALICE" # Replace it by the real message ID
PAYLOAD="0x50494e47" # "PING"

VALUE_INIT=0
VALUE_HANDLE=0
VALUE_REPLY=0

set -e

echo "Init message (upload):"
curl http://localhost:9933 -H "Content-Type:application/json;charset=utf-8" -d "{
    \"jsonrpc\":\"2.0\",
    \"id\":1,
    \"method\":\"gear_calculateInitUploadGas\",
    \"params\": [
        \"$ALICE\",
        \"\",
        \"$PAYLOAD\",
        $VALUE_INIT,
        true
    ]
}"

echo
echo "Init message (create):"
curl http://localhost:9933 -H "Content-Type:application/json;charset=utf-8" -d "{
    \"jsonrpc\":\"2.0\",
    \"id\":1,
    \"method\":\"gear_calculateInitCreateGas\",
    \"params\": [
        \"$ALICE\",
        \"$CODE_ID\",
        \"$PAYLOAD\",
        $VALUE_INIT,
        true
    ]
}"

echo
echo "Handle message:"
curl http://localhost:9933 -H "Content-Type:application/json;charset=utf-8" -d "{
    \"jsonrpc\":\"2.0\",
    \"id\":2,
    \"method\":\"gear_calculateHandleGas\",
    \"params\": [
        \"$ALICE\",
        \"$PROG_ID\",
        \"$PAYLOAD\",
        $VALUE_HANDLE,
        true
    ]
}"

echo
echo "Reply message:"
curl http://localhost:9933 -H "Content-Type:application/json;charset=utf-8" -d "{
    \"jsonrpc\":\"2.0\",
    \"id\":3,
    \"method\":\"gear_calculateReplyGas\",
    \"params\": [
        \"$ALICE\",
        \"$MSG_ID\",
        \"$PAYLOAD\",
        $VALUE_REPLY,
        true
    ]
}"

echo
